import React, { useState } from "react";
import { Switch, FormControl, FormControlLabel, FormGroup, FormLabel } from '@material-ui/core';
import { MuiThemeProvider, createTheme } from '@material-ui/core/styles';

import './css/App.css';

function App() {
	const [navigation, setNavigation] = useState([
		{
			label: 'Tela Inicial',
			icon: <ion-icon name="home-outline"></ion-icon>,
			subItens: null,
		},
		{
			label: 'Calculadoras',
			icon: <ion-icon name="calculator-outline"></ion-icon>,
			subItens: [
				{
					label: 'Macro Nutrientes',
					config: { hasSoloAnalisys: true },
					inputs: {
						productivity: {
							value: 35,
							unit: 'sc/ha',
							label: 'Produtividade Esperada'
						},
						distanceLines: {
							value: 3,
							unit: 'm',
							label: 'Distância entre Linhas'
						},
						distancePlants: {
							value: 1,
							unit: 'm',
							label: 'Distância entre Plantas'
						},
						temperature: {
							value: 20,
							unit: 'ºC',
							label: 'Temperatura média anual'
						},
						phosphor: {
							value: 8,
							unit: 'P mg/dm³',
							label: 'Fósforo'
						},
						potassium: {
							value: 80,
							unit: 'K mg/dm³',
							label: 'Potássio'
						},
					},
				},
				{ label: 'Correção de Acidez' },
				{ label: 'Micro Nutrientes' },
			],
		},
		{
			label: 'Cotações',
			icon: <div className='money-icon'>$</div>,
			subItens: null,
		},
		{
			label: 'Loja',
			icon: <ion-icon name="storefront-outline"></ion-icon>,
			subItens: null,
		}
	])

	const theme = createTheme({
		palette: {
			secondary: {
				main: '#FE5E31'
			}
		}
	});

	return (
		<div className='root'>
			<MuiThemeProvider theme={theme}>
				<h1 className='title'>Simulador</h1>
				<div className='solo-analisys'>
					<p className='solo-analisys-label'>Possuo analise de solo</p>
					<Switch
						color="secondary"
						checked={navigation[1].subItens[0].config.hasSoloAnalisys}
					/>

				</div>
			</MuiThemeProvider>
		</div>
	);
}

export default App;
